import React, { Component } from "react";
import { Breadcrumb } from "@gull";
import { Table } from "react-bootstrap";
import ReactPaginate from "react-paginate";
import SimpleCard from "@gull/components/cards/SimpleCard";
import { classList } from "@utils";

class BlankPage extends Component {
  state = {
    newUserList: [
      {
        name: "David Hopkins",
        email: "hopkins@gmail.com",
        photoUrl: "/assets/images/faces/2.jpg",
        status: "active",
      },
      {
        name: "James Mitchell",
        email: "petter@gmail.com",
        photoUrl: "/assets/images/faces/3.jpg",
        status: "pending",
      },
      {
        name: "Jessica Mitchell",
        email: "johndoe@gmail.com",
        photoUrl: "/assets/images/faces/4.jpg",
        status: "inactive",
      },
    ],
    topProductList: [
      {
        name: "Watch",
        date: "12-10-2019",
        price: 30,
        status: "delivered",
      },
      {
        name: "Iphone",
        date: "24-10-2019",
        price: 350,
        status: "pending",
      },
      {
        name: "Headphone",
        date: "11-11-2019",
        price: 10,
        status: "not delivered",
      },
    ],
  };

  setOpenItem = (name) => {
    if (name === this.state.openItem) {
      this.setState({ openItem: "" });
    } else this.setState({ openItem: name });
  };

  handlePageClick = (data) => {
    let pageNumber = data.selected;
    let offset = Math.ceil(pageNumber * this.props.perPage);
    this.setState({ offset: offset }, () => {
      console.log(data);
    });
  };

  getUserStatusClass = (status) => {
    switch (status) {
      case "active":
        return "bg-success";
      case "delivered":
        return "bg-success";
      case "inactive":
        return "bg-warning";
      case "not delivered":
        return "bg-warning";
      case "pending":
        return "bg-primary";
      default:
        break;
    }
  };

  getStatusTextColor = (status) => {
    switch (status) {
      case "In Stock":
        return "text-success";
      case "Low Stock":
        return "text-warning";
      case "Out of Stock":
        return "text-danger";
      default:
        return "text-primary";
    }
  };

  render() {
    let {
      newUserList = [],
      topProductList = [],
    } = this.state;


    return (
      <div>
        <Breadcrumb
          routeSegments={[
            { name: "Home", path: "/" },
            { name: "Pages", path: "/pages" },
            { name: "Blank Page" },
          ]}
        ></Breadcrumb>

        <div className="row">
                  <div className="col-md-6">
                    <div className="card o-hidden mb-4">
                      <div className="card-header d-flex card-title align-items-center mb-0">
                        <h3 className="w-50 float-left m-0">New Users</h3>
                      </div>

                      <div className="table-responsive">
                        <Table
                          hover
                          id="user_table"
                          className="table dataTable-collapse text-center"
                        >
                          <thead>
                            <tr>
                              <th scope="col">#</th>
                              <th scope="col">Name</th>
                              <th scope="col">Avatar</th>
                              <th scope="col">Email</th>
                              <th scope="col">Status</th>
                              <th scope="col">Action</th>
                            </tr>
                          </thead>
                          <tbody>
                            {newUserList.map((user, index) => (
                              <tr key={index}>
                                <th scope="row">{index + 1}</th>
                                <td>{user.name}</td>
                                <td>
                                  <img
                                    className="rounded-circle m-0 avatar-sm-table "
                                    src={user.photoUrl}
                                    alt=""
                                  />
                                </td>

                                <td>{user.email}</td>
                                <td>
                                  <span
                                    className={`badge ${this.getUserStatusClass(
                                      user.status
                                    )}`}
                                  >
                                    {user.status}
                                  </span>
                                </td>
                                <td>
                                  <span className="cursor-pointer text-success mr-2">
                                    <i className="nav-icon i-Pen-2 font-weight-bold"></i>
                                  </span>
                                  <span className="cursor-pointer text-danger mr-2">
                                    <i className="nav-icon i-Close-Window font-weight-bold"></i>
                                  </span>
                                </td>
                              </tr>
                            ))}
                          </tbody>
                        </Table>
                        <div className="px-3 pb-3 mt-3 d-flex flex-row justify-content-end">
                          <ReactPaginate
                            previousLabel={"Previous"}
                            nextLabel={"Next"}
                            breakLabel={"..."}
                            breakClassName={"break-me"}
                            pageCount={5}
                            marginPagesDisplayed={2}
                            pageRangeDisplayed={5}
                            onPageChange={this.handlePageClick}
                            containerClassName={"pagination"}
                            subContainerClassName={"pages pagination"}
                            activeClassName={"active"}
                          />
                        </div>
                      </div>
                    </div>
                  </div>

                  <div className="col-md-6">
                    <div className="card o-hidden mb-4">
                      <div className="card-header d-flex card-title m-0 align-items-center">
                        <h3 className="w-50 float-left card-title m-0">Total Sales</h3>
                      </div>

                      <div className="table-responsive">
                        <Table
                          hover
                          id="sales_table"
                          className="table dataTable-collapse text-center"
                        >
                          <thead>
                            <tr>
                              <th scope="col">#</th>
                              <th scope="col">Product</th>
                              <th scope="col">Date</th>

                              <th scope="col">Price</th>
                              <th scope="col">Status</th>
                              <th scope="col">Action</th>
                            </tr>
                          </thead>
                          <tbody>
                            {topProductList.map((product, index) => (
                              <tr key={index}>
                                <th scope="row">{index + 1}</th>
                                <td>{product.name}</td>
                                <td>{product.date}</td>
                                <td>${product.price}</td>
                                <td>
                                  <span
                                    className={`badge ${this.getUserStatusClass(
                                      product.status
                                    )}`}
                                  >
                                    {product.status}
                                  </span>
                                </td>
                                <td>
                                  <span className="cursor-pointer text-success me-2">
                                    <i className="nav-icon i-Pen-2 font-weight-bold"></i>
                                  </span>
                                  <span className="cursor-pointer text-danger me-2">
                                    <i className="nav-icon i-Close-Window font-weight-bold"></i>
                                  </span>
                                </td>
                              </tr>
                            ))}
                          </tbody>
                        </Table>
                        <div className="px-3 pb-3 mt-3 d-flex flex-row justify-content-end">
                          <ReactPaginate
